#include <stdio.h>
#include <stdlib.h>
#include <string.h>

int cmp(const void *a, const void *b) {
	return *(int*)a - *(int*)b;
}

int largestRectangleArea(int* heights, int heightsSize)
{
    if (heights == NULL || heightsSize == 0) {
        return 0; // 参数不对
    }
    int *a = (int *)calloc(sizeof(int), heightsSize);
    if (a == NULL) { // 申请内存失败 
    	return 0; 
	} 
	for (int i = 0; i < heightsSize; i++) {
		a[i] = heights[i];		
	}
	// a[i] 是排序后的高  
	qsort(a, heightsSize, sizeof(int), cmp);
	int cnt = 1; // 从1开始往后扫描 
	for (int i = 1; i < heightsSize; i++) {
		if (a[i] == a[i - 1]) { // 去重 
			continue;
		} else {
			a[cnt++] = a[i];
		} 
	}
	for (int i = 0; i < cnt; i++) {
		printf("%d,", a[i]);
	}
	printf("\n");
	
	int maxArea = 0;
	for (int i = 0; i < cnt; i++) { 
		int area = 0;
		for (int j = 0; j < heightsSize; j++) {
			if (heights[j] >= a[i]) {
				area += a[i]; // 面积可以再扩大
				if(maxArea < area) {
					maxArea = area;
				}
			} else {
				area = 0; // 重新计算 
			}			
		}
	}
	free(a); // 释放内存 
	return maxArea;
}

